const Input = ({ label, error, ...rest }) => {
   return (
      <div className="form-group my-1">
         <label htmlFor="email">
            {label} <span className="text-danger">*</span>
         </label>
         <input
            id={rest.name}
            className="form-control is-invalid"
            type="text"
         />
         <span className="invalid-feedback">error</span>
      </div>
   );
};

export default Input;
